e to use.'=>'(Standard: Inhaltstyp-Titelform) Die Abfrage-Variable muss hierzu aktiviert sein.','Custom Query Var Slug'=>'Selbst definierte query_var-Titelform','Slug to use in REST API URLs.'=>'Titelform die in REST API URLs verwendet wird.','REST API base slug'=>'REST API Titelform','Show in REST API'=>'In der REST-API anzeigen','Show in Nav Menus'=>'In Navigations-Menüs anzeigen','No taxonomies registered for display. Visit %s to get started.'=>'Keine registrierten Taxonomien zum Anzeigen. Besuche %s um loszulegen.','*Replace "term_slug" with the slug of the actual taxonomy term.'=>'*Ersetze „term_slug“ mit der Titelform des eigentlichen Taxonomie-Begriffs.','Archives'=>'Archive','No post types registered for display. Visit %s to get started.'=>'Keine registrierten Inhaltstypen zum Anzeigen. Besuche %s um loszulegen.','Template hierarchy Theme Handbook'=>'Template-Hierarchie Theme Handbuch','Single Posts file name examples.'=>'Einzelbeitrag Dateinamen-Beispiele.','Archives file name examples.'=>'Archiv Dateinamen-Beispiele.','Template Hierarchy'=>'Template-Hierarchie','Send debug info'=>'Schicke Informationen zur Fehlersuche','Please provide an email address to send debug information to: '=>'Gib bitte die E-Mail-Adresse an, an die du die Informationen zur Fehlersuche schicken willst:','%s Taxonomy'=>'%s Taxonomie','%s Post Type'=>'%s Inhaltstyp','This will not export the associated posts or taxonomy terms, just the settings.'=>'Dies wird nicht die verknüpften Beiträge oder Taxonomie-Begriffe exportieren, sondern nur die Einstellungen.','Debug Info'=>'Info zur Fehlersuche','What\'s new in version %s'=>'Was gibt es Neues in Version %s','If you have sought support for Custom Post Type UI on the forums, you may be requested to send the information below to the plugin developer. Simply insert the email they provided in the input field at the bottom and click the "Send debug info" button. Only the data below will be sent to them.'=>'Falls du in den Foren nach Hilfe für