 Blick auf die %s-Funktion hinsichtlich Dokumentation und Nutzungsbeispielen.','How do I add a newly registered taxonomy to a post type that already exists?'=>'Wie füge ich eine neu erstellte Taxonomie zu einem bereits existierenden Inhaltstypen hinzu?','How do I add custom metaboxes to my post type?'=>'Wie füge ich benutzerdefinierte Metaboxen zu meinem Inhaltstypen hinzu?','Advanced'=>'Erweitert','I have added categories and tags to my custom post type, but they do not appear in the archives.'=>'Ich habe Kategorien und Schlagwörter zu meinem selbst definierten Inhaltstypen hinzugefügt, aber sie werden nicht in den Archiven angezeigt.','How do I display my custom post type on my site?'=>'Wie kann ich meine selbst definierten Inhaltstypen auf meiner Website anzeigen lassen?','What template files should I edit to alter my post type display?'=>'Welche Template-Dateien sollte ich bearbeiten um die Anzeige meiner Inhaltstypen zu verändern?','Front-end Display'=>'Frontend Anzeige','Make sure your theme has post "post-thumbnails" theme support enabled.'=>'Stell sicher, dass dein Theme für Beiträge die Unterstützung von "Beitrags-Vorschaubilder“ aktiviert hat.','I have added post thumbnail and/or post format support to my post type, but those do not appear when adding a post type post.'=>'Ich habe das Vorschaubild des Beitrags sowie die Beitragsformat-Unterstützung zu meinem Inhaltstyp hinzugefügt. Diese werden aber nicht angezeigt wenn ich einen Inhaltstyp-Beitrag hinzufüge.','Renaming the slug for a post type or taxonomy creates a new entry in our saved option which gets registered as its own post type or taxonomy. Since the settings will be mirrored from the previous slug, you will just need to delete the previous version\'s entry.'=>'Die Umbenennung der Titelform eines Inhaltstyps oder einer Taxonomie erstellt einen neuen, eigenen Inhaltstyp oder Taxonomie. Nachdem die Einstellung aus der vorherigen Titelform übernommen worden sind musst du einfach den ursprünglichen Eintrag löschen.','I changed my custom post type or taxonomy slug and now I have duplicates shown. How do I remove the duplicate?'=>'Ich habe meine selbst definierte Inhaltstypen- oder Taxonomie-Titelform verändert und jetzt werden Duplikate angezeigt. Wie kann ich diese wieder entfernen?','You can either change the custom post type name back to the original name or try the Post Type Switcher plugin'=>'Du kannst entweder den Namen des selbst definierten Inhaltstypen auf den ursprünglichen zurücksetzen oder aber Du verwendest das Inhaltstypen-Wechsel-Plugin','I changed my custom post type name and now I can not get to my posts. How do I get them back?'=>'Ich habe den Namen meines selbst definierten Inhaltstypen verändert und jetzt habe ich keinen Zugriff mehr auf meine Beiträge. Wie bekomme ich diese wieder zurück?','General'=>'Allgemein','Support Forums'=>'Support-Foren','Custom Post Type UI Support'=>'Custom Post Type UI Hilfe','Please choose a different post type name. %s is already registered.'=>'Wähle bitte einen anderen Namen für den Inhaltstypen. %s ist bereits in Verwendung.','Please do not use quotes in post type/taxonomy names or rewrite slugs'=>'Verwende bitte keine Anführungszeichen in Inhaltstypen- und Taxonomie-Namen oder für Rewrite-Titelformen','Please provide a post type name'=>'Gib bitte einen Namen für den Inhaltstyp an','Please provide a post type to delete'=>'Gib bitte einen Inhaltstyp zum Löschen an','Adds %s support'=>'Fügt %s Unterstützung hinzu','Provide custom support slugs here.'=>'Hier stellst du eigene „Unterstützt“-Titelformen zur Verfügung.','Custom "Supports"'=>'Selbst definiertes „Unterstützt“','None'=>'Keiner','Use the "None" option to explicitly set "supports" to false.'=>'Hake die Checkbox "Keine" an um alle unterstützten Funktionen explizit zu deaktivieren.','Post Formats'=>'Beitrags-Formate','Page Attributes'=>'Seiten-Attribute','Author'=>'Autor','Featured Image'=>'Beitragsbild','Revisions'=>'Revisionen','Comments'=>'Kommentare','