ons.php file.'=>'Kopiere den Code in die Zwischenablage und füge ihn im Anschluss in deine functions.php-Datei ein.','Get Post Type and Taxonomy Code'=>'Erhalte Inhaltstyp- und Taxonomie-Code','Use the content above to import current taxonomies into a different WordPress site. You can also use this to simply back up your taxonomy settings.'=>'Benutze die Inhalte des "Taxonomie exportieren"-Feldes um die aktuellen Taxonomien in eine andere WordPress Website zu importieren. Du kannst dies ebenso einfach dazu benutzen um deine Taxonomie-Einstellungen zu sichern.','No taxonomies registered yet.'=>'Es wurden noch keine Taxonomien definiert.','To import taxonomies from a different WordPress site, paste the exported content from that site and click the "Import" button.'=>'Um Taxonomien von einer anderen WordPress Seite zu importieren, füge über die Zwischenablage die exportierten Inhalte dieser Seite ein und klicke den "Importieren“-Button.','Import Taxonomies'=>'Taxonomien importieren','Use the content above to import current post types into a different WordPress site. You can also use this to simply back up your post type settings.'=>'Benutze die Inhalte des „Inhaltstypen exportieren"-Feldes um die aktuellen Inhaltstypen in eine andere WordPress Website zu importieren. Du kannst dies ebenso einfach dazu benutzen um die Einstellungen deines Inhaltstyps zu sichern.','To copy the system info, click below then press Ctrl + C (PC) or Cmd + C (Mac).'=>'Um die System-Informationen zu kopieren, klicke unten und drücken dann Ctrl + C am PC oder Cmd + C  am Mac.','No post types registered yet.'=>'Es wurden noch keine Inhaltstypen erstellt.','Import'=>'Importieren','To import post types from a different WordPress site, paste the exported content from that site and click the "Import" button.'=>'Um die Inhaltstypen einer anderen WordPress-Seite zu importieren, füge deren exportierte Inhalte ein und klicke den "Importieren“-Button.','Importing will overwrite previous registered settings.'=>'Der Import wird die aktuell aktiven Einstellungen überschreiben.','Note:'=>'Anmerkung:','Paste content here.'=>'Inhalt hier einfügen.','Import Post Types'=>'Inhaltstypen importieren','NOTE'=>'Anmerkung','If you are wanting to migrate registered post types or taxonomies from this site to another, that will also use Custom Post Type UI, use the import and export functionality. If you are moving away from Custom Post Type UI, use the information in the "Get Code" tab.'=>'Für den Fall dass Du Inhaltstypen oder Taxonomien von dieser Website auf eine andere, die ebenso Custom Post Type UI nutzt, übertragen willst, benutze bitte die Import und Export Funktion. Solltest Du Custom Post Type UI den Rücken zukehren wollen dann folge bitte den Informationen im "Code holen“-Reiter.','Choose from the most used %s'=>'Aus den am häufigsten verwendeten %s auswählen','Add or remove %s'=>'%s hinzufügen oder entfernen','Separate %s with commas'=>'%s mit Kommas trennen','New %s name'=>'Neuer %s Name','Update %s'=>'%s aktualisieren','Parent %s:'=>'Übergeordnet %s:','Parent %s'=>'Übergeordnet %s','Popular %s'=>'Beliebte %s','No %s found in trash.'=>'Keine %s im Papierkorb gefunden.','No %s found.'=>'Keine %s gefunden.','Search %s'=>'%s durchsuchen','All %s'=>'Alle %s','View %s'=>'%s anzeigen','New %s'=>'%s hinzufügen','Edit %s'=>'%s bearbeiten','Add new %s'=>'Neue %s hinzufügen','%s has failed to be imported'=>'%s konnte nicht importiert werden','%s has been successfully imported'=>'%s wurde erfolgreich importiert','%s has failed to be deleted'=>'%s konnte nicht gelöscht werden','%s has been successfully deleted'=>'%s wurde erfolgreich gelöscht','%s has failed to be updated'=>'%s konnte nicht aktualisiert werden','%s has been successfully updated'=>'%s wurde erfolgreich aktualisiert','%s has failed to be added'=>'%s konnte nicht hinzugefügt werden','%s has been successfully added'=>'%s wurde erfolgreich hinzugefügt','Help'=>'Hilfe','Settings'=>'Einstellungen','Get Code'=>'Code hole